column8:
強化ガラス液晶保護フィルムはお持ちのスマートフォンの液晶を衝撃から保護するフィルムです。 
<br /> 指紋を防いで携帯の液晶画面をいつも美しく、いつも綺麗に・・・。 
<br /> そんなあなたにおすすめの指紋が目立ちにくくなるフィルムです。 
<br /> 
<br />■素材：強化ガラスフィルム 
<br />■対応機種：iPhone5/iPhone5S/iPhone6/iPhone6plus 
<br />■サイズ：厚さ3.3mm 
<br /> 
<br />※お客様のご覧になっているモニター等により多少色が異なる場合がございます。 
<br />あらかじめご了承ください。 
<br />ゆうパケット便のみの発送ですので、代引き決済、着日指定は出来ません。 
